import { Header } from "./Header";
import { Footer } from './Footer';
import './Basket.css';

function Rectangle18() {
  return (
    <div className="rectangle-18">
      <div className="purchase">PURCHASE</div>
    </div>
  );
}

export default function Basket() {
  return (
    <div id="main" className="main-container">
      <Header />
      <Footer />
      <Rectangle18 />
    </div>
  );
}
